### {COIN} Staking là gì?
{COIN} Staking là sản phẩm thế chấp trên chuỗi của Gate.io, cho phép người dùng thế chấp {COIN} và dễ dàng kiếm phần thưởng trên chuỗi thông qua {Network}.
### Quy tắc của {COIN} Staking
 Nếu bạn thế chấp {COIN} vào một ngày dương lịch nhất định (00:00 - 23:59 UTC), phần thưởng thế chấp sẽ được phát hành vào ngày D+{IncomeDay}.
Số tiền thế chấp tối thiểu:{MortgageMin} {COIN}
 Hạn mức thế chấp: {MortgageLimt}
 Số tiền thế chấp tối đa hàng ngày: {MortgageMax}
 ### Quy tắc đổi {COIN}
 Với tư cách là người nắm giữ {COIN}, bạn có thể đổi {COIN} của mình bất kỳ lúc nào. Tiền gốc và lợi nhuận của bạn sẽ được ghi có vào tài khoản của bạn vào ngày D+{RedeemDay} sau khi gửi yêu cầu quy đổi.
Số tiền quy đổi tối thiểu: {RedeemMin} {COIN}
 Số tiền quy đổi tối đa hàng ngày: {RedeemMax}

