Số tiền thế chấp tối thiểu:{MortgageMin} {COIN}
 Hạn mức thế chấp: {MortgageLimt}
 Số tiền thế chấp tối đa hàng ngày: {MortgageMax}
 ### Quy tắc đổi {COIN}
 Với tư cách là người nắm giữ {REWARD}, bạn có thể đổi {REWARD} của mình thành {COIN} theo tỷ lệ {ExchangeRate}:1. Tiền gốc và lợi nhuận sẽ được ghi có vào tài khoản của bạn ngay sau khi gửi yêu cầu quy đổi.
Số tiền quy đổi tối thiểu:{RedeemMin} {COIN}
 Số tiền quy đổi tối đa hàng ngày: {RedeemMax}
 ### {REWARD} là gì?
{REWARD} là một mã thông báo thế chấp thanh khoản tạo ra phần thưởng và đại diện cho số {COIN} bạn đã thế chấp theo tỷ lệ 1:{ExchangeRate}.

